import React, { Component } from 'react'
import { connect } from 'react-redux';
import Project from './Project';
import "../../Css/AsClient.css"

class AsClient extends Component {

    componentDidMount(){
        this.props.getClientProject();
    }

     componentWillReceiveProps(nextProps){
            if(nextProps.project){
                this.setState({
                    project: nextProps.project,
                    auth: nextProps.auth

                });
            }
     }
    
    render() {
        const { clientProject } = this.props.project;
        const { user } = this.props.project;

        let ProjectData;

        
              ProjectData = (
                           <div>
                            <Project project={clientProject} user= {user}/>
                         </div>
         )
        
          
     

     
        return (
            <div>
                {ProjectData}
            </div>
        )
    }
}


const mapStateToProps = (state) => ({
  project: state.project
});
export default connect(mapStateToProps, {    })(AsClient);
